import React from "react";
import Input from "./input";

const Login = () => {
  return (
    <React.Fragment>
      <div className="login-title">
        <h1>Login</h1>
      </div>
      <div className="input-container">
        <p className="login-title">Email</p>
        <Input name="email" autofocus="true" type="email" />
      </div>
    </React.Fragment>
  );
};

export default Login;
